00069     public DotNetSolutionModelBuilder AddDotNetProject(
00070         IDotNetProject dotNetProject,
00071         IEnvironmentProvider environmentProvider)
00072     {
00073         var solutionProjectEntry = GetSolutionProjectEntry(
00074             dotNetProject,
00075             environmentProvider);
00076 
00077         lock (_tokensLock)
00078         {
00079             IDotNetProject? newProjectToken = null;
00080             var allTokens = GetAllTokens();
00081 
00082             if (DotNetProjectList.Any())
00083             {
00084                 // If there is an existing project token, then insert the new
00085                 // project token immediately after the project token.
00086 
00087                 // This conditional branch needs a newline pre-pended.
00088                 solutionProjectEntry = '\n' + solutionProjectEntry;
00089 
00090                 IDotNetProject? lastValidProjectToken = null;
00091 
00092                 for (var i = DotNetProjectList.Length - 1; i >= 0; i--)
00093                 {
00094                     var entry = DotNetProjectList[i];
00095 
00096                     if (entry.CloseAssociatedGroupToken is not null)
00097                     {
00098                         lastValidProjectToken = entry;
00099                         break;
00100                     }
00101                 }
00102 
00103                 if (lastValidProjectToken is null || lastValidProjectToken.CloseAssociatedGroupToken is null)
00104                     return this;
00105 
00106                 var openStartingIndexInclusive =
00107                     lastValidProjectToken.CloseAssociatedGroupToken.Value.TextSpan.EndingIndexExclusive;
00108 
00109                 var openEndingIndexExclusive = openStartingIndexInclusive +
00110                     LexSolutionFacts.Project.PROJECT_DEFINITION_START_TOKEN.Length;
00111 
00112                 var openTextSpan = lastValidProjectToken.CloseAssociatedGroupToken.Value.TextSpan with
00113                 {
00114                     StartingIndexInclusive = openStartingIndexInclusive,
00115                     EndingIndexExclusive = openEndingIndexExclusive + solutionProjectEntry.Length
00116                 };
00117                 
00118                 dotNetProject.OpenAssociatedGroupToken = new OpenAssociatedGroupToken(openTextSpan);
00119                 
00120                 var closeEndingIndexExclusive =
00121                     lastValidProjectToken.CloseAssociatedGroupToken.Value.TextSpan.EndingIndexExclusive +
00122                     solutionProjectEntry.Length;
00123 
00124                 var closeStartingIndexInclusive = closeEndingIndexExclusive -
00125                     LexSolutionFacts.Project.PROJECT_DEFINITION_END_TOKEN.Length;
00126 
00127                 var closeTextSpan = lastValidProjectToken.CloseAssociatedGroupToken.Value.TextSpan with
00128                 {
00129                     StartingIndexInclusive = closeStartingIndexInclusive,
00130                     EndingIndexExclusive = closeEndingIndexExclusive
00131                 };
00132                 
00133                 dotNetProject.CloseAssociatedGroupToken = new CloseAssociatedGroupToken(closeTextSpan);
00134 
00135                 newProjectToken = dotNetProject;
00136             }
00137             else
00138             {
00139                 var global = DotNetSolutionGlobal;
00140 
00141                 if (global.OpenAssociatedGroupToken is null)
00142                     return this;
00143                 
00144                 var newProjectTextSpanStartingIndexInclusive = global.OpenAssociatedGroupToken.Value.TextSpan.StartingIndexInclusive;
00145 
00146                 var newProjectTextSpan = global.OpenAssociatedGroupToken.Value.TextSpan with
00147                 {
00148                     StartingIndexInclusive = newProjectTextSpanStartingIndexInclusive,
00149                     EndingIndexExclusive = newProjectTextSpanStartingIndexInclusive + solutionProjectEntry.Length
00150                 };
00151 
00152                 dotNetProject.OpenAssociatedGroupToken = new OpenAssociatedGroupToken(newProjectTextSpan);
00153                 dotNetProject.CloseAssociatedGroupToken = new CloseAssociatedGroupToken(newProjectTextSpan);
00154 
00155                 newProjectToken = dotNetProject;
00156             }
00157 
00158             DotNetProjectList = DotNetProjectList.Add(newProjectToken);
00159 
00160             SolutionFileContents = SolutionFileContents.Insert(
00161                 newProjectToken.OpenAssociatedGroupToken.TextSpan.StartingIndexInclusive,
00162                 solutionProjectEntry);
00163 
00164             UnsafeShiftTextAfterInsertion(
00165                 allTokens,
00166                 newProjectToken.OpenAssociatedGroupToken.TextSpan);
00167         }
00168 
00169         return this;
00170     }
