00186     private void UnsafeShiftTextAfterInsertion(
00187         ImmutableArray<(ISyntaxToken token, Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?> withFunc)> tokenTuplesToShift,
00188         TextEditorTextSpan insertedTextSpan)
00189     {
00190         for (int i = 0; i < tokenTuplesToShift.Length; i++)
00191         {
00192             var tokenTuple = tokenTuplesToShift[i];
00193 
00194             if (tokenTuple.token.TextSpan.StartingIndexInclusive >= insertedTextSpan.StartingIndexInclusive)
00195             {
00196                 var newTextSpan = tokenTuple.token.TextSpan with
00197                 {
00198                     StartingIndexInclusive = tokenTuple.token.TextSpan.StartingIndexInclusive + insertedTextSpan.Length,
00199                     EndingIndexExclusive = tokenTuple.token.TextSpan.EndingIndexExclusive + insertedTextSpan.Length,
00200                 };
00201 
00202                 tokenTuple.withFunc.Invoke(tokenTuple.token, newTextSpan);
00203             }
00204         }
00205     }
