00207     private ImmutableArray<(ISyntaxToken token, Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?> withFunc)> GetAllTokens()
00208     {
00209         var tokens = new List<(ISyntaxToken token, Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?> withFunc)>();
00210 
00211         foreach (var dotNetProject in DotNetProjectList)
00212         {
00213             tokens.Add((
00214                 dotNetProject.OpenAssociatedGroupToken,
00215                 new Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?>((inToken, textSpan) =>
00216                 {
00217                     var outOpenAssociatedGroupToken = dotNetProject.OpenAssociatedGroupToken with
00218                     {
00219                         TextSpan = textSpan
00220                     };
00221 
00222                     dotNetProject.OpenAssociatedGroupToken = outOpenAssociatedGroupToken;
00223                     return null;
00224                 })));
00225 
00226             if (dotNetProject.CloseAssociatedGroupToken is not null)
00227             {
00228                 tokens.Add((
00229                     dotNetProject.CloseAssociatedGroupToken,
00230                     new Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?>((inToken, textSpan) =>
00231                     {
00232                         dotNetProject.CloseAssociatedGroupToken = new CloseAssociatedGroupToken(textSpan);
00233                         return null;
00234                     })));
00235             }
00236         }
00237         
00238         var global = DotNetSolutionGlobal;
00239 
00240         if (global.OpenAssociatedGroupToken is not null)
00241         {
00242             tokens.Add((
00243                 global.OpenAssociatedGroupToken,
00244                 new Func<ISyntaxToken, TextEditorTextSpan, ISyntaxToken?>((inToken, textSpan) =>
